import React from 'react'

const SupportApplication: any = ({ Component, PageProps} : any) => {
  return (
    <div className='container'>
      <p>{PageProps.message}</p>
    </div>
  )
}

SupportApplication.getInitialProps = async (appContext: any) => {
  const { Component, ctx } = appContext
  const customContext = {
    ...ctx,
  }
  let pageProps

  if (Component.getInitialProps) {
    pageProps = (await Component.getInitialProps(customContext)) as any
  }
  return {
    pageProps: {
      message: appContext.message
    },
  }
}

export default SupportApplication
